*{
  padding: 0;
  margin: 0;
  box-sizing: border-box;
  font-family: Arial, Helvetica, sans-serif;
  // overflow: hidden;
}

body{
    width: 100vw;
    height: 100%;
    overflow-x: hidden;
    scroll-behavior: smooth;
}

button{
  background-color: rgba(255, 255, 255, 0);
  border: none;
  cursor: pointer;
}

//FONTS

@font-face{
    font-family: "MaisonNeue-Book";
    src: url("../assets/fonts/MaisonNeueTRIAL-Book.otf") format("opentype");
  }
  
  @font-face{
    font-family: "MaisonNeue-BookItalic";
    src: url("../assets/fonts/MaisonNeueTRIAL-BookItalic.otf") format("opentype");
  }
  
  @font-face{
    font-family: "MaisonNeue-LightItalic";
    src: url("../assets/fonts/MaisonNeueTRIAL-LightItalic.otf") format("opentype");
  }
  
  @font-face{
    font-family: "MaisonNeue-Bold";
    src: url("../assets/fonts/MaisonNeueTRIAL-Bold.otf") format("opentype");
  }

  //VARIABLES

  $cta-light: #fafafa;
  

  //MIXINS
  @mixin middle-column{
    grid-column-start: 2;
    grid-column-end: 3;
  }

  @mixin flex-column-center{
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
  }

  @mixin drop-shadow{
        box-shadow: 0px 1px 6px 1px rgba(0,0,0,0.17);
  }
  // @mixin corner-gradient{
  //   background: linear-gradient(90deg, rgba(0,0,0,0.8928370100728582) 8%, rgba(0,0,0,0) 53%);
  //   position: absolute;
  //   width: 100%;
  //   height: 100%;
  //   opacity: 0.49;
  // }

  @mixin cta{
    border: 2px solid #fafafa;
    border-radius: 999px;
    background-color: rgba(255, 255, 255, 0);

    color: #fafafa;
    font-family: "MaisonNeue-Bold";
    text-transform: uppercase;
    font-size: 1em;
    
    align-self: baseline;
    display: inline-block;
    padding: 1.05em 2.7em;
    cursor: pointer;
    z-index: 0;
    transition: background-color 0.4s;

    position: relative;
    overflow: hidden;
  }

  @mixin cta-before{
  content: "";
  width: 100%;
  height: 100%;
  position: relative;
  background-color: lime;
  left: -100%;
  top: 0;
  position: absolute;
  transition: all 0.2s;
  z-index: -1;
  mix-blend-mode: multiply;
  opacity: 0.8;
  }

  @mixin slider-bullet{
    height: 13px;
    width: 13px;
    border: 2px solid #acacac;
    margin: 0 4px;
    border-radius: 999px;
    cursor: pointer;
  }
@mixin headline{
    white-space: nowrap;
    text-transform: uppercase;
    font-family: "MaisonNeue-Bold";
    position: absolute;
    // top: 0;
    left: 0;
    top: 3.29vw;
    display:flex;
    align-items: center;
    color: #9d9d9d;
}
@mixin headline-mobile{
  font-size: 3.91vw;
}
@mixin headline--text{
    // color: #9d9d9d;
    font-size: 1vw;
}
@mixin headline--dash{
    background-color: #9d9d9d;
    height: 2px;
    width: 1.406vw;
    margin: auto 0;
    margin-right: 1.67vw;
    min-width: 20px;
}

  // .grid, 
  // .logos, .carousel, .map{
  //   display: none;
  // }

  .wrapper{
    width: 100vw;
    overflow: hidden;
    display: grid;
    grid-template-rows: [nav]min-content [haeder]calc(100vh - 70px) [txt]auto [grid]auto [testimonials]auto [logos]auto [map]auto [footer]auto;
    // -ms-grid-rows: unquote("min-content calc(100vh - 70px) (auto)[6]");
    grid-template-columns: [margin-left]14.6vw [middle-content]auto 14.6vw;
    // grid-template-columns: [margin-left]minmax(40px, 14.6vw) [middle-content]auto minmax(40px, 14.6vw);
    position: relative;
  }

   @media screen and (max-width: 768px), 
   screen and (max-height: 786px){
      .wrapper{    
        grid-template-rows: min-content calc(100vh - 60px) 87vh auto;
        grid-template-columns: [margin-left]13.125vw [middle-content]auto 13.125vw;
        }
    }

  @import "partials/nav";
  @import "partials/header";
  @import "partials/txt";
  @import "partials/grid";
  @import "partials/testimonials";
  @import "partials/carousel";
  @import "partials/map";

  @import "partials/footer";

  .slick-track { display: none; }

