footer{
    grid-column-start: 2;
    grid-column-end: 3;
    grid-row-start: 8;
    grid-row-end: 9;

    height: 282px;
    font-family: "MaisonNeue-Book";
    font-size: 14px;
    position: relative;

    padding: 48px 0px 43px 30px;
}
footer::before{
    content: "";
    position: absolute;
    width: 200%;
    height: 100%;
    left: -50%;
    background-color: #fafafa;
    z-index: -1;
    top: 0;
}

//ADDRESS BOX

.footer--address{
}
.footer--address__bold{
    font-family: "MaisonNeue-Bold";
}
.footer--address__regular
, .footer--copyright
// , .footer-navigation-link--text
{
    color: #555555;
}

//NAVIGATION

.footer-navigation{
    list-style-type: none;
    display: flex;
    justify-content: space-between;
    width: 360px;
}
.footer-navigation-link{
    width: 100px;
    position: relative;
    white-space: nowrap;
}
.footer-navigation-link--text{
    color: #000000;
    position: relative;
    text-decoration: none;
    width: 100px;
}
.footer-navigation-link::before{
    content:'';
    height: 10px;
    width: 100%;
    background-color: #5ffd82;
    position: absolute;
    top: 9px;
    left: -5px;
    transition: all 0.2s;
    z-index: -1;
  }

  .footer-navigation
  , .footer--copyright{
  position: absolute;
  bottom: 43px;
  }
  .footer--copyright{
      right: 0;
  }
